items:
Характеристика и преимущества квартиры:
- общая площадь составляет 40.7 м2, жилая - 16.3 м2; кухня - 13.1 м2.
- расположена на 1-ом этаже;
-  совмещенный санузел;
- наличие застекленной лоджии, с возможностью организации зоны отдыха.
Что расположено рядом с ЖК "Vogue: 
- дом находится рядом с обширной территорией парка Челюскинцев и Ботанического сада.  Также менее 1 км отделяют его от парка Писателей;
- в шаговой доступности расположены детский сад, школа, колледж, супермаркеты и строительный магазин;
- жилой комплекс находится минутах ходьбы от станций метро "Московская" (750м) и "Парк Челюскинцев"(850м). 
- В 100 метровой доступности от квартиры расположена остановка  общественного транспорта;
- напротив дома имеются кофейни, отделения банков, салоны красоты, медицинские центры и аптеки.
